import Link from 'next/link';

const Menu = () => {
    return (
        <ul>
            <Link href="/"><a>Home</a></Link>
            <Link href="/sobre"><a>Sobre</a></Link>
            <Link href="/contato"><a>Contato</a></Link>
        </ul>
    );
}

export default Menu;
